/* eslint-disable react/prop-types */
// import styles from './profile.module.css';

import React from 'react';

function Profile({ user }) {
  const { uuid } = useParams();
  const PROFILE_API_URL = `https://randomuser.me/api/?uuid=${uuid}`;

  return (
    <>
      <div>
        {' '}
        <h1 className="text-2xl font-bold mb-3">
          {user.name.first}
          {user.name.last}
        </h1>
        <div>
          <img src={user.picture.medium} alt={user.name.firstname} />
        </div>
        <div className="font-bold text-lg mb-3">{user.login.username}</div>
        <div className="font-bold text-lg mb-3">{user.gender}</div>
        <div className="font-bold text-lg mb-3">
          {user.location.street.number}
        </div>
        <div className="font-bold text-lg mb-3">
          {user.location.street.name}
        </div>
        <div className="font-bold text-lg mb-3">{user.city}</div>
        <div className="font-bold text-lg mb-3">{user.state}</div>
        <div className="font-bold text-lg mb-3">{user.postcode}</div>
        <div className="font-bold text-lg mb-3">{user.country}</div>
        <div className="font-bold text-lg mb-3">{user.email}</div>
        <div className="font-bold text-lg mb-3">{user.phone}</div>
        <div className="font-bold text-lg mb-3">{user.cell}</div>
        <div className="font-bold text-lg mb-3">{user.dob}</div>
      </div>
    </>
  );
}

export default Profile;
